script: |
  super -f text -I q5397.spq | sort > q5397.out

inputs:
  - name: q5397.spq
    data: |
      SELECT ALL 41 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 / + col2 * + + col0 + + + col1 NOT BETWEEN col2 / + + CAST ( + - col1 AS INTEGER ) + - - CAST ( NULL AS INTEGER ) AND + 2;
  - name: tab1

outputs:
  - name: q5397.out
    data: |
      41
      41
      41
